MatterTitle:
Resolution approving the decision of the City Planning Commission on ULURP No. C 050073 ZSM (L.U. No. 321), for the grant of a special permit pursuant to Section 74-902 of the Zoning Resolution to permit the allowable community facility floor area ratio of Section 24-11 (Maximum Floor Area and Percentage of Lot Coverage) to apply to a 7-story non-profit institution with sleeping accommodations.
 ..Body

By Council Members Katz and Avella

     	WHEREAS, the City Planning Commission filed with the Council on March 11, 2005 its decision dated March 2, 2005 (the "Decision") on the application submitted by the Department of Housing Preservation and Development, pursuant to Sections 197-c and 201 of the New York City Charter, for the grant of a special permit pursuant to Section 74-902 of the Zoning Resolution to permit the allowable community facility floor area ratio of Section 24-11 (Maximum Floor Area and Percentage of Lot Coverage) to apply to a proposed approximately 36,225 square foot, 7-story Non-Profit Institution with Sleeping Accommodations (U.G. 3A), on property located at 435-439 East 119th Street (Block 1807/Lots 15 and 16), in an R7-2 District, Community District 11, Borough of Manhattan (ULURP No.  C 050073 ZSM) (the "Application");

    	WHEREAS, the Application is related to ULURP Application Number C 050072 HAM (L.U. No. 320), an urban development action area project designation and project approval and the disposition of city-owned property;

     	WHEREAS, the City Planning Commission has made the findings required pursuant to Section 74-902 of the Zoning Resolution;

WHEREAS, the Decision is subject to review and action by the Council pursuant to Section 197-d(b)(1) of the City Charter;

      	WHEREAS, upon due notice, the Council held a public hearing on April 4, 2005 on the Decision and Application;

	WHEREAS, the Council has considered the relevant environmental issues and the Negative Declaration, issued on August 17, 2004 (CEQR No. 03HPD006M); and

_________

      	WHEREAS, the Council has considered the land use implications and other policy issues relating to the Decision and Application;       	       	       	       	       	       		
RESOLVED:

     	The Council finds that the action described herein will have no significant effect on the environment; and

      	Pursuant to Sections 197-d and 200 of the New York City Charter and on the basis of the Decision and Application, the Council approves the Decision.


Adopted.


Office of the City Clerk, 
